SELECT	(CASE
WHEN COUNT(*)>0 THEN 'Y'
ELSE 'N'
END )
FROM	<?=snpRef.getObjectName("L", "W_ETL_LOAD_DATES", "D") ?>
WHERE	PACKAGE_NAME = '<?
if(odiRef.getSession("SCEN_NAME").equals("")){
	out.print("");
} else {
	out.print(odiRef.getSession("SCEN_NAME"));
}
?>'
AND	(DATASOURCE_NUM_ID=#BIAPPS.DATASOURCE_NUM_ID
OR	DATASOURCE_NUM_ID=#BIAPPS.WH_DATASOURCE_NUM_ID)
AND 	ETL_USAGE_CODE = '#BIAPPS.ETL_USAGE_CODE'
AND	COMMITTED='1'

SELECT
  COALESCE(TO_CHAR(MIN( (ETL_LOAD_DATE+(-1)*#BIAPPS.PRUNE_DAYS)), 'YYYY-MM-DD HH24:MI:SS'),
                     '2015-09-01 00:00:00'  )
FROM   <?=snpRef.getObjectName("L", "W_ETL_LOAD_DATES", "D") ?>
WHERE PACKAGE_NAME = '<?
if(odiRef.getSession("SCEN_NAME").equals("")){
	out.print("");
